import React from 'react';
import './Home.css';


function Home(props) {
    return (
        <div className='home'>
            <h1 id='head'>" Today? "</h1>
            <p>“Earth provides enough to satisfy every man's needs, but not every man's greed.”
― Mahatma Gandhi </p>
        </div>
    );
}

export default Home;
